VALUES ('7622210311368', 'Choco Suprême', 'Chocolat au tait du pays alpin 60 % [sucre, eurre de cacao, pâte de cacao, lait écrémé en poudre, lactosérum en poudré (de lait), beurre pâtissier, émulsifiant (lécithine de soja), arôme], farine de blé, graisses végétales (palme, noix de coco en proportions variables), sucre, lactosérum en poudre (de lait), cacao maigre en poudre 2 %, huile de colza, émulsifiant (lécithine de soja), poudre à lever (carbonate acide de sodium), sel, arôme. Peut contenir oeuf et fruits à coque. A conserver à l\'abri de la chaleur et de l\'humidité. Une exposition à la chaleur ou au soleil peut entraîner la formation d\'un voile blanc à la surface du chocolat. omhuld met Alpenmelkchocolade (60 %) en met een cacaovulling (27 %). Ingrediënten: Alpenmelkchocolade 60 % [suiker, cacaoboter, cacaomassa, magere melkpoeder, weipoeder (van melk), melkvet, emulgator (sojalecithine), aromal, tarwebloem, plantaardige vetten (palm, kokos in wisselende verhoudingen), suiker, weipoeder (van melk), magere cacaopoeder 2 %, koolzaadolie, emulgator (sojalecithine), rijsmiddel (natriumwaterstofcarbonaat), zout, aroma. Kan ei en noten bevatten. Droog en uit de warmte bewaren. Warmte of zonlicht kan leiden tot de vorming van een onschuldig wit laagje op de chocotade.', '', '31', '18', '56', '43.33', '2.8', '6.8', '0.4', '0.15748031496063', '', '0');

